import React from "react";
import "../card/card.styles.css";

export const Card = (props) => {
	const { name, id } = props.monster.name;
	return (
		<div className="card-container">
			<img
				src={`https://robohash.org/${id}?set=set2&size=180X180`}
				alt="monster"
			/>
			<h1>{name}</h1>
		</div>
	);
};
